identification:
  title: Evaluation Of Soil Nutrients By Using Type-1 Fuzzy Set
  abstract: "<em>To study the status and quantity of available soil nutrients in soil\
    \ study was conducted in typical farm of Miraj, Sangli district in Maharashtra\
    \ sample from each farm were collected and scientifically analysed. The subjective\
    \ information is quantified by using fuzzy sets. The problem of selection of soil\
    \ containing \u201Chigh\u201D availability of Nitrogen ( N ), Phosphate ( P )\
    \ and \u201Cmedium\u201D Potassium ( K ) is demonstrated as application of type-1\
    \ fuzzy set.</em>"
